<script setup lang="ts">
    import { defineProps, ref } from 'vue';

    const flipped = ref(false);
    const currency = ref('GBP');

    const props = defineProps({
        isOpen: {
            type: Boolean
        },
        onClose: {
            type: Function,
            required: true
        }
    });

    const flipToFront = () => {
        flipped.value = false;
    };

    const flipToBack = (newCurrency:string) => {
        flipped.value = true;
        currency.value = newCurrency;
    };

    const close = () => {
        if (flipped.value) {
            setTimeout(() => props.onClose(), 500);
            flipped.value = false;
        } else {
            props.onClose();
        }
    }
</script>

<template>
    <div class="backdrop" :class="{ 'is-open': isOpen }" @click.self="close()" />
    <div class="backdrop-container" :class="{ 'is-open': isOpen }"  @click.self="close()">
        <section class="outer" :class="{ 'outer--flipped': flipped }" >
            <div class="red-pocket red-pocket--front" >
                <div class="close" @click="close()" />
                <div class="currencies">
                    <div class="currency" @click="flipToBack('HKD')"><em>港元</em> Hong Kong Dollar</div>
                    <div class="currency" @click="flipToBack('EUR')"><em>€</em> Euro</div>
                    <div class="currency" @click="flipToBack('GBP')"><em>£</em> Pound</div>
                </div>
            </div>
            <div @click="flipToFront" class="red-pocket red-pocket--back">
                <div  class="back" />
                <div class="details" :class="'details--'+currency"></div>
            </div>
        </section>
    </div>
</template>

